        <li> <Link to='/Afficher' >Afficher</Link> </li>
        <li> <Link to='/Ajouter' >Ajouter</Link> </li>
        <li> <Link to='/Modifier' >Modifier</Link> </li>
        </ul>
        <div>
            <Outlet />
        </div> 
      </nav>
    
  )
}
